/*
#!/usr/bin/env bash

# Use this to create a highlight.js version with all languages we need
VERSION='9.12.0'
OUTPUT="highlight-$VERSION.js"
URL="https://raw.githubusercontent.com/isagalaev/highlight.js/$VERSION"

LANGUAGES='matlab fortran asciidoc ruby mathematica erlang objectivec java '
LANGUAGES+='javascript nginx markdown json php diff apache vim http less css '
LANGUAGES+='cs xml delphi vbscript armasm scss makefile dockerfile ini bash '
LANGUAGES+='perl elixir coffeescript tex cpp python sql'

printf "/""*\n" > $OUTPUT
cat $0 >> $OUTPUT
printf "*""/\n" >> $OUTPUT

curl "$URL/src/highlight.js" >> $OUTPUT
for language in $LANGUAGES
do
    printf "hljs.registerLanguage('$language'," >> $OUTPUT
    curl "$URL/src/languages/$language.js" >> $OUTPUT
    printf ");\n" >> $OUTPUT
done
*/
